import React from "react";

let SearchListData = [
    {
        title : 'R',
        subtitle : 'raraar'
    }
]

function SearchList () {
    return (
        <>
            <div className="search-list-container">
                {SearchListData.map((d, i) => (
                    <div className="search-list-block">
                        <div className="search-list-title">{title}</div>
                        <div className="search-list-sub-title">{subtitle}</div>
                    </div>

                ))}
            </div>
        </>
    );
}

export default SearchList;
